import React from "react";
import TodoItem from "./todoItem";

const styles = {
    ul: {
      listStyle: 'none',
      margin: 0,
      padding: 0,
    }
}

export default function TodoList(props){
    return (
        <ul style={styles.ul}>
           <TodoItem/>
           <TodoItem/>
           <TodoItem/>
        </ul>
    )
}
